import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import SideNavbar from "../../components/Doctor/sidenavbar";
import Navbar from "../../components/Doctor/Navbar";
import "../../css/Doctor/ddashboard.css";

export default function UploadSchedule() {
  // Define dummy schedule data
  const dummyData = {
    schedule: {
      slots: [
        [2024, 4, 5, 11, 15],
        [2024, 4, 6, 15, 45],
        [2024, 4, 7, 15, 0],
        [2024, 4, 2, 15, 45],
        [2024, 4, 5, 15, 0]
      ],
      appointments: [
        { id:1, date: new Date(getNextDates()[0]), time: '09:00', patientName: 'John Doe' },
        { id:2, date: new Date(getNextDates()[4]), time: '10:30', patientName: 'somebody someone' },
        { id:3, date: new Date(getNextDates()[1]), time: '11:15', patientName: 'Alice Smith' },
        { id:4, date: new Date(getNextDates()[3]), time: '12:00', patientName: 'Bob Johnson' },
        { id:5, date: new Date(getNextDates()[5]), time: '09:00', patientName: 'John Doe' }
      ]
    }
  };

  // State for schedule data
  const [schedule, setSchedule] = useState([]);

  // State for editing mode
  const [isEditing, setIsEditing] = useState(false);

  useEffect(() => {
    // Initialize schedule with dummy data
    setSchedule(dummyData.schedule);
  }, []);

  // Function to toggle editing mode
  const handleEdit = () => {
    setIsEditing(!isEditing);
  };

  // Function to handle cell click (toggle availability)
  const handleCellClick = (dateIndex, timeIndex) => {
    // Handle cell click logic here
  };

  // Function to generate time slots from 9:00 AM to 3:45 PM with 45 minutes interval
  const generateTimeSlots = () => {
    let timeSlots = [];
    let currentTime = new Date(2024, 0, 1, 9, 0); // Start from 9:00 AM
    const endTime = new Date(2024, 0, 1, 15, 45); // End at 3:45 PM

    while (currentTime <= endTime) {
      timeSlots.push(currentTime.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' }));
      currentTime.setMinutes(currentTime.getMinutes() + 45);
    }

    return timeSlots;
  };

  // Function to generate table rows for schedule
  const generateScheduleRows = () => {
    const timeSlots = generateTimeSlots();

    return schedule.slots.map((slot, dateIndex) => (
      <tr key={`${slot[0]}-${slot[1]}-${slot[2]}`}>
        <th scope="row">{slot[0]}-{slot[1]}-{slot[2]}</th>
        {timeSlots.map((timeSlot, timeIndex) => {
          const isSlotAvailable = slot[3] === dateIndex && slot[4] === timeIndex;
          const isSlotBooked = schedule.appointments.some(appointment => {
            const appointmentTime = new Date(appointment.date);
            return appointmentTime.getHours() === dateIndex + 9 && appointmentTime.getMinutes() === timeIndex * 45;
          });

          let cellClass = isSlotAvailable ? 'table-success bg-success text-white' : '';
          cellClass = isSlotBooked ? 'table-danger bg-danger text-dark' : cellClass;

          return <td key={`${slot[0]}-${slot[1]}-${slot[2]}-${timeSlot}`} className={cellClass}></td>;
        })}
      </tr>
    ));
  };

  return (
    <div className='dashboard-container'>
      <Navbar />
      <div className= 'dashboard-content'>
        <SideNavbar />
        <div className="main-content">
          <h2>This week's Schedule</h2>
          <table className="table table-bordered custom-box khus">
            <thead>
              <tr>
                <th></th>
                {generateTimeSlots().map((timeSlot, index) => (
                  <th key={index}>{timeSlot}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {generateScheduleRows()}
            </tbody>
          </table>

          <button type="button" className="btn btn-primary custom-button" onClick={handleEdit}>
            {isEditing ? 'Cancel Edit' : 'Edit Schedule'}
          </button>
          {isEditing && (
            <button type="button" className="btn btn-primary custom-button" onClick={handleSubmit}>
              Submit
            </button>
          )}
        </div>
      </div>
    </div>
  );
}
